let contactDatabaseParsed=JSON.parse(localStorage.getItem("contactDatabaseStored")),contactElement=document.getElementById("contactContent");for(let t=0;t<contactDatabaseParsed.length;t++){let e=contactDatabaseParsed[t],a=t%2;contactElement.innerHTML+=`\n    <article class="contactItem contactItem${a}" id="${e.service}">\n        <img src="${e.icon}" class="contactIcon">\n        <h2 class="service">${e.service}</h2>\n        <a href="${e.location}"><h3 class="service">${e.tag}</h3></a>\n    </article>\n    `}